import { LinearProgress, Stack, Typography } from "@mui/material";

interface PollResultProps {
  pollText: string;
  pollVotes: number;
  pollVotePercentage?: number;
}

const PollResult = (props: PollResultProps): JSX.Element => {
  return (
    <Stack>
      <Typography variant="body1">{props.pollText}</Typography>
      <Typography variant="subtitle2">{props.pollVotes}</Typography>
      <LinearProgress value={props?.pollVotePercentage} />
    </Stack>
  );
};

export default PollResult;
